interface Personal{
    name:string
    age:number
    mail:string
}

const Record = (props: {Personal: Personal}) => {
    const Personal = props.Personal

    return(
        <tr>
            <td>{Personal.name}</td>
            <td>{Personal.age}</td>
            <td>{Personal.mail}</td>
            <td><button>年齢加算</button></td>
            <td>msg</td>
        </tr>

    )

}


console.log(Record)

export default Record
